import React, { Component } from 'react';

class Checkboxdone extends Component {
    state = { checked: true }
  handleCheckboxChange1 = event =>
    this.setState({ checked: event.target.checked }) 

    render() {
        const Checkbox = props => (
            <input id="2" type="checkbox" {...props} />
          )
        return (
            <>
                 <div className="col-md-3 123">
                      <div class="custom-checkbox">
                             {/* <input  type="checkbox"  /> */}
                             <Checkbox
            checked={this.state.checked}
            onChange={this.handleCheckboxChange1}
          />
                              <label for="2">Enabled Unselected</label>
                        </div>
                 </div> 
                 <div className="col-md-3 123">
                      <div class="custom-checkbox indeterminate">
                             {/* <input  type="checkbox"  /> */}
                             <input id="1" type="checkbox" />
                              <label for="1">Enabled Unselected</label>
                        </div>
                 </div>  
            </>
        ); 
    }
}

export default Checkboxdone;
